\u0412\u043e\u043f\u0440\u043e\u0441 8.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
В анекдоте женщину пилили, чтобы узнать, сколько у нее годовых колец;
Эмиль Кио известен, в том числе, многочисленными вариациями фокуса с
распиливанием женщины.

\u0412\u043e\u043f\u0440\u043e\u0441 2.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Появились у Моисея после латинского перевода ивритской фразы
"&#1493;&#1511;&#1512;&#1503; &#1488;&#1493;&#1512;
&#1508;&#1504;&#1497;&#1493;" (его лицо светилось светом).

\u0412\u043e\u043f\u0440\u043e\u0441 22.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Любопытно, что все роли играют мужчины, а основательница - женщина;
О-Куни - явно японское имя; "началось с женщины" - небольшой намек на
знаменитую фразу о том, что театр начинается с вешалки.
